import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the login form to be visible
    await page.waitForSelector('form#loginForm');

    // Fill in the email and password fields
    await page.fill('#email', 'your_email@example.com'); // Replace with actual email
    await page.fill('#password', 'your_password'); // Replace with actual password

    // Click the login button
    await page.click('button.login-btn');

    // Wait for the profile page to load
    await page.waitForLoadState('networkidle');

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract the profile photo URL
    const profilePhotoUrl = await page.evaluate(() => {
      const imgElement = document.querySelector('img[alt="Profile picture"]');
      return imgElement ? imgElement.src : null;
    });

    // Download the profile photo
    if (profilePhotoUrl) {
      const response = await page.goto(profilePhotoUrl);
      const buffer = await response.buffer();
      const fs = require('fs');
      fs.writeFileSync(path.join(screenshotsDir, 'profile_photo.png'), buffer);
    }

    return {
      success: true,
      action: "Downloaded own profile photo",
      extractedData: { profilePhotoUrl },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

